import React, { Component } from "react";
import { NavLink } from "react-router-dom";


class Login extends Component {


    render() {
        return (
            <React.Fragment>
                <div className="row mt-3">

                    <div className="col form-group">
                        <h1 className="loginText" style={{ color: "#93329e" }}>Login</h1>

                        <form method="post" action="/login">
                            <p>
                                <label htmlFor="email">Email:</label>
                                <input type="text" id="email" name="emailLogin" />
                            </p>
                            <p>
                                <label htmlFor="password">Password:</label>
                                <input type="password" id="password" name="passwordLogin" />
                            </p>
                            <input className="btn" style={{ backgroundColor: "#ffd880" }} type="submit" value="Login" />
                        </form>
                    </div>
                </div>
                <h1 className="loginText mt-4" style={{ color: "#93329e" }}>Already Registered?</h1>
                <h2 className="loginText" style={{ color: "#93329e" }}>Login</h2>

                <button style={{ color: "#ffc107" }} className="btn btn-outline-warning m-2"><NavLink to="/Register">Register</NavLink></button>


            </React.Fragment >

        )



    }
}
export default Login;
